// Check if the connection was successful
if ($mysqli->connect_error) {
    die('Connection failed: ' . $mysqli->connect_error);
}

// Query to fetch data from the age_group table
$query = "SELECT * FROM age_group";

// Execute the query
$result = $mysqli->query($query);

// Initialize variables to store the sums for each age group and total age_percentage
$population0to14 = 0;
$population15to64 = 0;
$population65above = 0;
$agePercentage0to14 = 0;
$agePercentage15to64 = 0;
$agePercentage65above = 0;

while ($row = $result->fetch_assoc()) {
    $ageGroup = intval($row['age_group']);
    $population = intval($row['population_2015']);
    $agePercentage = floatval($row['age_percentage']);

    if ($ageGroup >= 0 && $ageGroup <= 14) {
        $population0to14 += $population;
        $agePercentage0to14 += $agePercentage; // Store age_percentage for 0-14 age group
    } elseif ($ageGroup >= 15 && $ageGroup <= 64) {
        $population15to64 += $population;
        $agePercentage15to64 += $agePercentage; // Store age_percentage for 15-64 age group
    } elseif ($ageGroup >= 65) {
        $population65above += $population;
        $agePercentage65above += $agePercentage; // Store age_percentage for 65+ age group
    }
}

// Close the database connection
$mysqli->close();
?>

